settings.colorFunction:
var bus_stop_status = dsData[dsIndex]['bus_stop_status'];
var health_status = dsData[dsIndex]['health_status'];

if(health_status == 'Warning'){
    return dsData[dsIndex]['bus_health_color'];
} else if(health_status == 'Damaged'){
    return dsData[dsIndex]['bus_health_color'];
}

if (bus_stop_status == 'Arrived') {
    return "#3B9AE1";
}else {
    return "#198038";
}

settings.markerImageFunction:
var occupancy = dsData[dsIndex]['occupancy'];
var res = { size: 50 };
var bus_stop_status = dsData[dsIndex]['bus_stop_status'];
var health_status = dsData[dsIndex]['health_status'];


if(health_status == 'Warning'){
    res.url =  images[1];
} else if(health_status == 'Damaged'){
    res.url =  images[2];
} else if (bus_stop_status == 'Arrived') {
    res.url = images[3];
}else {
    res.url = images[0];
}


return res;

